import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
    return (
        <nav className="Nav">
            <ul>
                <li>
                    <Link className="navLink" to="/">
                        Home
                    </Link>
                    <Link className="navLink" to="/about">
                        About
                    </Link>
                </li>
            </ul>
        </nav>
    );
};

export default Nav;
